marker = ""
string = ""

def find_index(s, target):
    for i in range(len(s)):
        if s[i] == target:
            return i
i = 0
while len(marker) < 4:
    if string[i] not in marker:
        marker += string[i]

    else:
        idx = find_index(marker, string[i])
        marker = marker[idx + 1:] + string[i]
    i += 1

print(i, marker)
